import React from 'react'

let array = [
    {
        num: "1",
        question:"whats you name",
        answer:"shailesh"
    },
    {
        num: "2",
        question:"whats you game",
        answer:"volleyball"
    },
]
function Formbuild() {
    function StructureCreator({num , question,yes}){
        const structure = `
        <p class="list">${num}</p>
        <p class="list">${question}</p>
        <p class="list">${yes}</p>
        `
        return <>
         {structure}
        </>
    }

  return (
    <div>
      <StructureCreator num={2} question={"sshs"} yes="s"/>
    </div>
  )
}

export default Formbuild
